export class Recu {
    constructor() { }
    getNumerorecu() { return this.numerorecu; }
    ;
    getDateEmission() { return this.dateEmission; }
    ;
    getColis() { return this.colis; }
    ;
    getExpediteur() { return this.expediteur; }
    ;
    getDestinataire() { return this.destinataire; }
    ;
    getMontanttotal() { return this.montanttotal; }
    ;
    setNumerorecu(numerorecu) { this.numerorecu = numerorecu; }
    ;
    setDateEmission(dateEmission) { this.dateEmission = dateEmission; }
    ;
    setColis(colis) { this.colis = colis; }
    ;
    setExpediteur(expediteur) { this.expediteur = expediteur; }
    ;
    setDestinataire(destinataire) { this.destinataire = destinataire; }
    ;
    setMontanttotal(montanttotal) { this.montanttotal = montanttotal; }
    ;
}
